import React, {useState, useEffect} from 'react';
import { Device } from '@twilio/voice-sdk'
import utils from '../utils/phoneUtils';

function Phone(props) {
    const [token, setToken] = useState(null);
    const device = new Device();

    useEffect(()=>{
        let isMounted = true;

        const getData = async ()=>{
            return await utils.generateToken('test');
        };

        getData().then(
            resp =>{
                if (isMounted) {
                    setToken(resp.token)
                }
            }
        );
        return () => { isMounted = false };
    },[]);


    if (token) {
        device.setup(token)
    }

    return (
        <div>
            Phone
        </div>
    );
}

export default Phone;
